import React from 'react'
import img from "../Component/pics/web1.jpg"

const HomeSection = () => {
    var navbar = document.getElementsByClassName('home_section')

    window.onscroll = () => {
    
      // pageYOffset or scrollY
      if (window.pageYOffset > 0) {
        navbar.classList.add("scrolled")
      } else {
        navbar.classList.add("scrolled")
      }
    }

    return (
        <>
            <section>
                <div className="home_section">
                    <div className="home_center_section">
                <img src={img} alt="" />
                        <div className="home_header">
                            <span>A FREELANCER</span>
                        </div>
                        <div className="head_developer animate__bounce">
                            <span>Web Developer</span>
                        </div>
                        <div className="header-quote">
                            <span>IF IT DOESN’T CHALLENGE YOU, IT DOESN’T CHANGE YOU</span>
                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default HomeSection
